import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';
import { useState } from "react";
import bakeryData from "./bakery-data.json";

function SortButtons({changeSort}) {
    return (
        <FormControl>
            <FormLabel id="demo-radio-buttons-group-label">Sort By</FormLabel>
            <RadioGroup
                aria-labelledby="demo-radio-buttons-group-label"
                defaultValue="Price"
                name="radio-buttons-group"
            >
                <FormControlLabel value="Price" control={<Radio />} label="Price" onClick={()=> {changeSort("Price")}} />
                <FormControlLabel value="Alphabet" control={<Radio />} label="Alphabet" onClick={()=> {changeSort("Alphabet")}} />
            </RadioGroup>
      </FormControl>
